import React from 'react';
import { TextInput } from './TextInput';

export const Workshop = ({ registration }) => {
    if(registration)
        return (
            <form>
                <TextInput name={'Name'} label={'Nombre'}/>
                <input>Datos de contacto</input>
            </form>
        );
    else
        return(
            <form>
                <input>Nombre</input>
            </form>
        );
}
